            // width : "100%",
            marginTop : 20
        },

    },
    aboutUsMain : {
        display : "flex",
        justifyContent : "flex-end"
    },
    aboutUsContent : {
        display : "flex",
        justifyContent : " center"
    }, 
    firstRow : {
        [theme.breakpoints.only("sm")] : {
            paddingBottom : 70
        }
    },
    commonStyle : {
        marginBottom : 30
    },
    subscribeWrapper : {
        backgroundColor: "#FFFFFF",
        boxShadow: "0px 3px 6px rgba(0, 0, 0, 0.16)",
        borderRadius: 10,
        display : "flex",
        flexDirection : "row",
        justifyContent : "space-between",
        paddingTop : 30,
        paddingLeft : 50,
        paddingRight : 50,
        paddingBottom : 30,
        [theme.breakpoints.down('md')] : {
            flexDirection : "column",
        }
    },
    subscribeInputWrapper : {
        display : "flex",
        justifyContent : "space-between",
        [theme.breakpoints.down('md')] : {
            flexDirection : "column"
        }
    },
    inputWidth : {
