        [theme.breakpoints.down("md")] : {
            width : "100% !important"
        }
    },
    subscribeButtonWrappper : {
        width : "35%",
        [theme.breakpoints.down("md")] : {
            width : "100% !important"
        }
    },
    inputField : {
        width : "90%",
        [theme.breakpoints.down("md")] : {
            width : "100% !important",
        }
    },
    footer : {
        backgroundColor : "#34A76C",
        height : 50,
    }
})

